angular.module("index",[]).config(["$routeProvider",function(n){return n.when("/",{templateUrl:"/Content/app/index.tpl.html",controller:"IndexCtrl"})}]).controller("IndexCtrl",["$scope","$http",function(n,t){return n.$parent.title="Home",n.$parent.showBanner=!0,n.loading="Loading",t.get("/Content/data/words.js").success(function(t){return n.$parent.word=t[Math.floor(Math.random()*t.length+1)-1],n.loading=""})}])